/**
 *
 * @param clFoRmX $formx
 */
function diags_static(clFoRmX $formx)
{
	$tabDiags = getTabThesauDiags() ;
	$current_cat = $formx->getFormVar( 'diag_categorie' ) ;
	$tabRetour = array() ;
	foreach ( $tabDiags as $tabDiag )
	{
		if ( $tabDiag['nomliste'] == utf8_decode($current_cat) )
		{
			$tabRetour[$tabDiag['code']] = $tabDiag['nomitem'] ;
		}
	}
	return $tabRetour ;
}



